import React,{Component} from 'react';
import axios from 'axios'
class Log extends Component {

constructor(props){
  super(props)
  this.state={
     username:'',
     password:'',


   }
}

   chnguser=(e)=>{
     this.setState({username:e.target.value})
   }
   changepass=(e)=>{
     this.setState({password:e.target.value})
   }

   Loginee(){
     fetch(' http://127.0.0.1:8000/api/log_in/',{
       method:"POST",
       body:JSON.stringify(this.state)
     }).then((response)=>{
       response.json().then((result)=>{
         console.warn("result",result)
         localStorage.setItem('Login',JSON.stringify({
           Login:true,
           token:result.token
         }))
       })
     })
   }
render(){
const{username, password}=this.state
return(

<div>
<h1>login with jwt</h1>
<div>

<input type='text' name=" username"id="username"onChange={this.chnguser} value={username}/>
<input type='text'id="password" name="password" onChange={this. changepass}value={password}/>
<button onClick={this.Loginee} >login</button>
</div>
</div>

)

}




}
export default Log;
